import React from 'react';

function Category() {
    return (
        <div>
            <button>냉장고</button>
            <button>전공책</button>
            <button>킥보드, 자전거</button>
            <button>가구</button>
            <button>옷</button>
            <button>원룸</button>
        </div>
    );
}

export default Category;
